import React from 'react'

function SearchResults(searchResults) {
  console.log("Search Results given:"+searchResults)
  return (
    <div>
      <h1>SearchResults</h1>
      {props.searchResults.map((track) => {
        return(
          <div>{track.name}</div>
        )
      })}
      </div>
  )
}

export default SearchResults
